import React from 'react';
import './CloudFlexbox.css';

function CloudFlexbox() {
  return (
    <div className="cloud-container">
        <h1 className="title" style={{ fontFamily: 'sans-serif', textAlign: 'center' }}>Projects</h1>
        <div className="flex-item">Item 1</div>
        <div className="flex-item">Item 2</div>
        <div className="flex-item">Item 3</div>
        <div className="flex-item">Item 4</div>
    </div>
  );
}

export default CloudFlexbox;
